struct ListNode {
	int val;
    ListNode *next;
	ListNode(int x) : val(x), next(NULL) {}
};

typedef struct Pair {
	ListNode *first;
	ListNode *second;
	Pair(): first(NULL), second(NULL){}
}Pair;

class Solution {
private:
    ListNode *selectSort(ListNode *head);
    void quicksort(ListNode *begin, ListNode* end);
    ListNode *quicksort_3w(ListNode *begin, ListNode *end);
    ListNode *sortListS1(ListNode *head);
    ListNode *sortListS2(ListNode *head);
public:
    ListNode *sortList(ListNode *head);
};

void Solution::quicksort(ListNode *begin, ListNode *end) {
    if ( (end == NULL) || (begin == end) || (end->next == begin) )  return;
    int pivot = end->val;
    ListNode *i = NULL, *j = begin;
    while ( j != end ) {
        if ( j->val <= pivot) {
            if (!i) i = begin;
            else i = i->next;
            int tmp = i->val;
            i->val = j->val;
            j->val = tmp;
        }
        j = j->next;
    }
    ListNode *preI = i;
    if (!i) i= begin;
    else i = i->next;
    end->val = i->val;
    i->val = pivot;
    quicksort( begin, preI);
    quicksort( i->next, end);
}

ListNode *Solution::quicksort_3w(ListNode *begin, ListNode *end) {
    if ( begin == end)  return begin;
    if ( begin == NULL) return NULL;
    if ( (end) && (begin == end->next) ) return end;
    ListNode *originBegin = begin;
    ListNode *split = NULL, *cursor = begin;
    int pivot = begin->val;
    while ( (cursor->next != end) && (cursor->next->val == pivot) ) cursor = cursor->next;
    split = cursor;
    ListNode *newEnd = cursor;
    assert(cursor != end);
    cursor = cursor->next;
    while ( cursor != end ) {
        int current = cursor->val;
        if ( current < pivot) {
            ListNode *tmp = cursor->next;
            cursor->next = begin;
            begin = cursor;
            cursor = tmp;
        } else {
            newEnd->next = cursor;
            newEnd = cursor;
            cursor = cursor->next;
        }
    }
    if (end) {
        if ( end->val < pivot) {
            end->next = begin;
            begin = end;
        } else {
            newEnd->next = end;
            newEnd = end;
        }
    } else {
        newEnd->next = NULL;
        newEnd = NULL;
    }
    split->next = quicksort_3w(split->next, newEnd);
    if (originBegin == begin)   return begin;
    return quicksort_3w( begin, split);
}

Pair partition(ListNode *head, ListNode *tail) {
	ListNode *pivot = head, *smaller = head->next, 
			 *head_tail = head, *cursor = head;
	Pair pair;
	int pivot_val = pivot->val;
	
	while ((cursor->next!= NULL)&&(cursor->next->val == head->val)){
		cursor = cursor->next;
		head_tail = head_tail->next;
	}
	pair.first = head;
	pair.second = head_tail;

	smaller = head_tail->next;
	ListNode *tmp = NULL;
	int current = 0;

	while (smaller != tail){
		current = smaller->val;
		if (current < pivot_val) {
			pair.first->val = current;
			smaller->val = pivot_val;
			pair.first = pair.first->next;
			pair.second = pair.second->next;
		} else if (current == pivot_val) {
			pair.second = smaller;
		} else {
			tmp = smaller->next;	
			int exchange_flag = 0;
			while(tmp != tail) {
				if (tmp->val <= pivot_val) {
					int small_val = tmp->val;
					tmp->val = smaller->val;
					smaller->val = small_val;
					exchange_flag = 1;
					break;
				}
				tmp = tmp->next;
			}
			if (!exchange_flag)
				break;
			continue;
		}
		smaller = smaller->next;
	}
	return pair;
}

void quickSort(ListNode *head, ListNode *tail){
	stack<ListNode*> s_list;
	s_list.push(head);
	s_list.push(tail);
	ListNode *begin = NULL, *n_end = NULL;
	Pair bound_pair;
	while(!s_list.empty()){
		n_end = s_list.top();
		s_list.pop();
		begin = s_list.top();
		s_list.pop();
		if (begin == NULL)
			continue;
		if (begin == n_end)
			continue;
		if (begin->next == n_end)
			continue;
		bound_pair = partition(begin, n_end);
		if ( (bound_pair.first != begin) && (bound_pair.first != begin->next) ) {
			s_list.push(begin);
			s_list.push(bound_pair.first);
		}	
		if ((bound_pair.second->next != n_end)) {
			s_list.push(bound_pair.second->next);
			s_list.push(n_end);
		}
	}
}
ListNode* quickSortOptimal(ListNode *head, ListNode *tail) {
	if (head == NULL)
		return head;
	if (head == tail)
		return head;
	if (head->next == tail)
		return head;
	ListNode *right_begin = head, *head_tail = head, *cursor = head->next; 
	int pivot_val = head->val;
	int current = 0;

	while ((head_tail->next != NULL) && (head_tail->next->val == pivot_val)) head_tail = head_tail->next;
	right_begin = head_tail;
	cursor = head_tail->next;

	ListNode *newhead = head;
	while (cursor != tail) {
		current = cursor->val;	
		if (current < pivot_val) {
			ListNode *tmp = newhead;
			newhead = cursor;
			cursor = newhead->next;
			newhead->next = tmp;
		} else {
			head_tail->next = cursor;
			head_tail = cursor;
			cursor = cursor->next;
		}
	}
	head_tail->next = tail;
	if (right_begin->next != tail) right_begin->next = quickSortOptimal(right_begin->next, tail);
	if (newhead == head) return head;
	else return quickSortOptimal(newhead, head);
}

ListNode *Solution::sortListS1(ListNode *head){
	if (head == NULL) return head;
	if (head->next == NULL) return head;
	head = quicksort_3w(head, NULL);//quickSortOptimal(head, NULL);
	return head;
}

ListNode *Solution::sortListS2(ListNode *head){
	if (head == NULL) return head;
    ListNode *cursor = head;
    while (cursor->next) { cursor = cursor->next; }
    this->quicksort(head, cursor);
	return head;
}

ListNode *Solution::sortList(ListNode *head) {
    sortListS1(head);
    return head;
}

