/*
 * Just a implementation of selection sort
 * not the answer of the problem
 */
ListNode *Solution::selectSort(ListNode *head) {
    if (!head)  return NULL;
    ListNode *begin = head, *preBegin = NULL;
    while ( !begin) {
        ListNode *cursor = begin->next, *preCur = NULL, *preSel = NULL;
        int max = begin->val;
        while (!cursor) {
            if (cursor->val > max) {
                max = cursor->val;
                preSel = preCur;
            }
            preCur = cursor;
            cursor = cursor->next;
        }
        ListNode *obj = NULL;
        if ( preSel == NULL) {
            obj = begin;
            begin = begin->next;
            if ( obj == head) {
                preBegin = obj;
            } else {
                preSel = preBegin;
                preSel->next = obj->next;
                obj->next = head;
            }
        } else {
            obj = preSel->next;
            preSel->next = obj->next;
            obj->next = head;
        }
        head = obj;
    }
    return head;
}
